import React from 'react'
// import PropTypes from 'prop-types'
import "./style.css";
import { Navbar, NavItem } from "react-materialize"

function Nav(props) {
    return (
        <Navbar className="navbar orange" fixed="true" brand='Bryson Nelson' right>
            <NavItem href='get-started.html'><div className="navbar-item">About Me</div></NavItem>
            <NavItem href='get-started.html'><div className="navbar-item">Contact Me</div></NavItem>
            <NavItem href='get-started.html'><div className="navbar-item">Portfolio</div></NavItem>
        </Navbar>
    )
}

export default Nav
